import { render } from "react-dom";
import './index.css';
import App from './App';
import "./reset.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";


render(

  <BrowserRouter>
    <Routes>

      <Route path="/" element={<App />} />

    </Routes>

  </BrowserRouter>
  ,

  document.getElementById('root')
);
